import React, { useState } from "react";

import { Img, Text, Button } from "components";
import { useNavigate } from "react-router-dom";
import "./LandingPageNavbar.css";

const LandingPageNavbar = (props) => {
  const navigate = useNavigate();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <>
      {isMobileMenuOpen ? (
        <div className="mobile-navbar-expanded">
          <div className="mobile-navbar-expanded-top">
            <div className="hamburger" onClick={toggleMobileMenu} />
            <Img
              src="images/img_image1.png"
              className="waffle-logo"
              alt="imageOne"
            />
          </div>
          <Text
            className="nav-item"
            variant="body3"
            onClick={() => navigate("/#product")}
          >
            {props?.product}
          </Text>
          <Text
            className="nav-item"
            variant="body3"
            onClick={() => navigate("/newsfeed")}
          >
            {props?.readnews}
          </Text>
          <Button
            className="nav-item join-waitlist"
            onClick={() => navigate("/waitlist")}
            shape="RoundedBorder10"
            size="md"
            variant="FillOrangeA100"
          >
            {props?.joinWaitlist}
          </Button>
        </div>
      ) : (
        <div className={`landing-page-navbar ${props.className}`}>
          <div className="hamburger" onClick={toggleMobileMenu} />
          <div className="nav-item-container">
            <Img
              src="images/img_image1.png"
              className="waffle-logo"
              alt="imageOne"
            />
            <Text
              className="nav-item"
              variant="body3"
              onClick={() => navigate("/#product")}
            >
              {props?.product}
            </Text>
            <Text
              className="nav-item"
              variant="body3"
              onClick={() => navigate("/newsfeed")}
            >
              {props?.readnews}
            </Text>
            <Button
              className="nav-item join-waitlist"
              onClick={() => navigate("/waitlist")}
              shape="RoundedBorder10"
              size="md"
              variant="FillOrangeA100"
            >
              {props?.joinWaitlist}
            </Button>
          </div>
        </div>
      )}
    </>
  );
};

LandingPageNavbar.defaultProps = {
  waffle: "Waffle.",
  product: "Product",
  readnews: "Read News",
  joinWaitlist: "Join waitlist",
};

export default LandingPageNavbar;
